script: |
  super -f text -I q1123.spq | sort > q1123.out

inputs:
  - name: q1123.spq
    data: |
      SELECT DISTINCT + col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 74 NOT BETWEEN + col2 + - - col1 + - + 11 * col2 AND ( col0 );
  - name: tab2

outputs:
  - name: q1123.out
    data: |
      58
